import React from "react";
import { Page } from "../components/Page";
import Duotone from "../img/logo/Duotone.png";
import EO from "../img/logo/EO.png";

const partnerData = [
  {
    title: "EO Studio",
    desc:
      "EO는 국내 최고의 스타트업 영상 미디어이자 기업가 정신과 기회에서 이야기를 발굴하는 콘텐츠 스타트업입니다. <br /> 창업, 취업, 진로, 교육, 임팩트 투자, 스타트업, 기업가 정신 등의 분야에 있어 최고의 영상제작과 스토리텔링 능력을 가지고 있습니다.",
    logo: EO,
  },
  {
    title: "DUOTONE",
    desc:
      "듀오톤은 내일의 디지털 프로덕트를 위한 전략과 프로세스를 수립하고, 디자인 시스템을 설계합니다. <br /> 다양한 관점으로 사용자의 문제에 공감하고, 완성도 높고 균형 잡힌 디자인 결과물을 함께 만들어나갑니다.",
    logo: Duotone,
  },
];

export function Partner({ myRef }) {
  return (
    <Page center={false} myRef={myRef} marginBottom={300}>
      <div className="title">
        <div className="heading-1">Creative Partner</div>
      </div>
      <div className="partner-container">
      {partnerData.map((x, i) => {
        return (
            <div className="partner-item">
          <div style={{ textAlign: "center" }}>
            <img src={x.logo} alt="EO Logo" style={{ height: 60 }} />
          </div>
          <div className="partner-item-info">


          <div className="partner-item-info-text">
              <div className="heading-5">{x.title}</div>
              <div className="body-1">
                {x.desc}
              </div>
            </div>
            <div>
              <div className="btn">{x.title} 바로가기 ></div>
            </div>
          </div>
          </div>
        )
        })}


        <div
          style={{
            display: "grid",
            gridGap: 40,
            gridTemplateColumns: "1fr 1fr",
            justifyContent: "center",
            alignItems: "center",
          }}
        >
          <div style={{ textAlign: "center" }}>
            <img src={Duotone} alt="Duotone Logo" style={{ height: 50 }} />
          </div>
          <div
            style={{
              display: "grid",
              gridGap: 40,
            }}
          >
            <div
              style={{
                display: "grid",
                gridGap: 8,
              }}
            >
              <div className="heading-5">DUOTONE</div>
              <div className="body-1">
                듀오톤은 내일의 디지털 프로덕트를 위한 전략과 프로세스를
                수립하고, 디자인 시스템을 설계합니다. <br /> 다양한 관점으로
                사용자의 문제에 공감하고, 완성도 높고 균형 잡힌 디자인 결과물을
                함께 만들어나갑니다.
              </div>
            </div>
            <div>
              <div className="btn">DUOTONE 바로가기 ></div>
            </div>
          </div>
        </div>
      </div>
    </Page>
  );
}
